import React from "react"
import Light from "./Light"

class LightGrid extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div id="light-grid">   
                this.props.colors.map((color, i) => {
                    <Light key={`${color}-`}/>
                }
                )
            </div>
        )
    }
}

export default LightGrid
